func connectWithRetry(workerIndex int, addr string) gorTcpConn {
	var retries uint64
	conn, err := connect(addr)
	for {
		if err == nil {
			break
		}

		fmt.Println("==> output worker[", workerIndex, "] tcp connect failed, reconnection in 1 second. failed", retries, "times.", "error:", err)
		time.Sleep(1 * time.Second)
		conn, err = connect(addr)
		retries++
	}

	fmt.Println("==> output worker[", workerIndex, "] connect success.")
	return gorTcpConn{
		working: true,
		conn:    conn,
	}
}

func connect(addr string) (net.Conn, error) {
	var d net.Dialer
	ctx, cancel := context.WithTimeout(context.Background(), 5*time.Second)
	defer cancel()
	return d.DialContext(ctx, "tcp", addr)
}
